/** @jsx jsx */
import { css, jsx } from "@emotion/core";

import profile from "./profile.jpg";

export default function BioHeader(props) {
  return (
    <header
      className="card"
      css={css`
        display: flex;
        text-align: left;
        align-items: middle;
        justify-content: space-between;
      `}
    >
      <div css={css``}>
        <img
          src={profile}
          css={css`
            height: 150px;
            border-radius: 4px;
          `}
        />
      </div>
      <div css={css``}>
        <h1
          css={css`
            margin: 0;
          `}
        >
          Thomas Adrian Gerard
        </h1>
        <h6
          css={css`
            margin: 0;
          `}
        >
          aspiring developer, designer, and digital-first journalist
        </h6>
      </div>
    </header>
  );
}
